var moment=require("../../moment");exports.gettersSetters={setUp:function(b){moment.createFromInputFallback=function(){throw new Error("input not handled by moment")};b()},getters:function(d){d.expect(8);var a=moment([2011,9,12,6,7,8,9]);d.equal(a.year(),2011,"year");d.equal(a.month(),9,"month");d.equal(a.date(),12,"date");d.equal(a.day(),3,"day");d.equal(a.hours(),6,"hour");d.equal(a.minutes(),7,"minute");d.equal(a.seconds(),8,"second");d.equal(a.milliseconds(),9,"milliseconds");d.done()},"getters programmatic":function(d){var a=moment([2011,9,12,6,7,8,9]);d.equal(a.get("year"),2011,"year");d.equal(a.get("month"),9,"month");d.equal(a.get("date"),12,"date");d.equal(a.get("day"),3,"day");d.equal(a.get("hour"),6,"hour");d.equal(a.get("minute"),7,"minute");d.equal(a.get("second"),8,"second");d.equal(a.get("milliseconds"),9,"milliseconds");d.equal(a.get("weekday"),a.weekday(),"weekday");d.equal(a.get("isoWeekday"),a.isoWeekday(),"isoWeekday");d.equal(a.get("week"),a.week(),"week");d.equal(a.get("isoWeek"),a.isoWeek(),"isoWeek");d.equal(a.get("dayOfYear"),a.dayOfYear(),"dayOfYear");d.done()},"setters plural":function(d){d.expect(8);var a=moment();a.years(2011);a.months(9);a.dates(12);a.hours(6);a.minutes(7);a.seconds(8);a.milliseconds(9);d.equal(a.years(),2011,"years");d.equal(a.months(),9,"months");d.equal(a.dates(),12,"dates");d.equal(a.days(),3,"days");d.equal(a.hours(),6,"hours");d.equal(a.minutes(),7,"minutes");d.equal(a.seconds(),8,"seconds");d.equal(a.milliseconds(),9,"milliseconds");d.done()},"setters singular":function(d){d.expect(8);var a=moment();a.year(2011);a.month(9);a.date(12);a.hour(6);a.minute(7);a.second(8);a.millisecond(9);d.equal(a.year(),2011,"year");d.equal(a.month(),9,"month");d.equal(a.date(),12,"date");d.equal(a.day(),3,"day");d.equal(a.hour(),6,"hour");d.equal(a.minute(),7,"minute");d.equal(a.second(),8,"second");d.equal(a.millisecond(),9,"milliseconds");d.done()},setters:function(d){d.expect(9);var a=moment();a.year(2011);a.month(9);a.date(12);a.hours(6);a.minutes(7);a.seconds(8);a.milliseconds(9);d.equal(a.year(),2011,"year");d.equal(a.month(),9,"month");d.equal(a.date(),12,"date");d.equal(a.day(),3,"day");d.equal(a.hours(),6,"hour");d.equal(a.minutes(),7,"minute");d.equal(a.seconds(),8,"second");d.equal(a.milliseconds(),9,"milliseconds");a=moment("20130531","YYYYMMDD");a.month(3);d.equal(a.month(),3,"month edge case");d.done()},"setter programmatic":function(d){var a=moment();a.set("year",2011);a.set("month",9);a.set("date",12);a.set("hours",6);a.set("minutes",7);a.set("seconds",8);a.set("milliseconds",9);d.equal(a.year(),2011,"year");d.equal(a.month(),9,"month");d.equal(a.date(),12,"date");d.equal(a.day(),3,"day");d.equal(a.hours(),6,"hour");d.equal(a.minutes(),7,"minute");d.equal(a.seconds(),8,"second");d.equal(a.milliseconds(),9,"milliseconds");a=moment("20130531","YYYYMMDD");a.month(3);d.equal(a.month(),3,"month edge case");d.done()},"setters strings":function(d){d.expect(7);var a=moment([2012]).locale("en");d.equal(a.clone().day(0).day("Wednesday").day(),3,"day full name");d.equal(a.clone().day(0).day("Wed").day(),3,"day short name");d.equal(a.clone().day(0).day("We").day(),3,"day minimal name");d.equal(a.clone().day(0).day("invalid").day(),0,"invalid day name");d.equal(a.clone().month(0).month("April").month(),3,"month full name");d.equal(a.clone().month(0).month("Apr").month(),3,"month short name");d.equal(a.clone().month(0).month("invalid").month(),0,"invalid month name");d.done()},"setters - falsey values":function(d){d.expect(1);var a=moment();a.minutes(1);a.minutes(0);d.equal(a.minutes(),0,"falsey value");d.done()},"chaining setters":function(d){d.expect(7);var a=moment();a.year(2011).month(9).date(12).hours(6).minutes(7).seconds(8);d.equal(a.year(),2011,"year");d.equal(a.month(),9,"month");d.equal(a.date(),12,"date");d.equal(a.day(),3,"day");d.equal(a.hours(),6,"hour");d.equal(a.minutes(),7,"minute");d.equal(a.seconds(),8,"second");d.done()},"day setter":function(d){d.expect(18);var a=moment([2011,0,15]);d.equal(moment(a).day(0).date(),9,"set from saturday to sunday");d.equal(moment(a).day(6).date(),15,"set from saturday to saturday");d.equal(moment(a).day(3).date(),12,"set from saturday to wednesday");a=moment([2011,0,9]);d.equal(moment(a).day(0).date(),9,"set from sunday to sunday");d.equal(moment(a).day(6).date(),15,"set from sunday to saturday");d.equal(moment(a).day(3).date(),12,"set from sunday to wednesday");a=moment([2011,0,12]);d.equal(moment(a).day(0).date(),9,"set from wednesday to sunday");d.equal(moment(a).day(6).date(),15,"set from wednesday to saturday");d.equal(moment(a).day(3).date(),12,"set from wednesday to wednesday");d.equal(moment(a).day(-7).date(),2,"set from wednesday to last sunday");d.equal(moment(a).day(-1).date(),8,"set from wednesday to last saturday");d.equal(moment(a).day(-4).date(),5,"set from wednesday to last wednesday");d.equal(moment(a).day(7).date(),16,"set from wednesday to next sunday");d.equal(moment(a).day(13).date(),22,"set from wednesday to next saturday");d.equal(moment(a).day(10).date(),19,"set from wednesday to next wednesday");d.equal(moment(a).day(14).date(),23,"set from wednesday to second next sunday");d.equal(moment(a).day(20).date(),29,"set from wednesday to second next saturday");d.equal(moment(a).day(17).date(),26,"set from wednesday to second next wednesday");d.done()}};